      require([
        "esri/Map",
        "esri/views/MapView",
        "esri/Graphic",
        "esri/layers/GraphicsLayer",
        "esri/geometry/Polygon",
        "esri/geometry/Polyline", // Import Polyline
        "esri/symbols/SimpleFillSymbol",
        "esri/symbols/SimpleLineSymbol", // Import SimpleLineSymbol
      ], function (
        Map,
        MapView,
        Graphic,
        GraphicsLayer,
        Polygon,
        Polyline,
        SimpleFillSymbol,
        SimpleLineSymbol
      ) {
        var map = new Map({
          basemap: "topo-vector",
        });
        map.on("load", function () {
          map.graphics.enableMouseEvents();
        });

        var view = new MapView({
          container: "viewDiv",
          map: map,
          center: [107.2425931, 10.5559004],
          zoom: 11.5,
          highlightOptions: {
            color: "blue",
          },
        });
        var createPointGraphic = function (data) {
          return new Graphic({
            geometry: {
              type: "point",
              longitude: data.coordinates[0],
              latitude: data.coordinates[1],
            },
            symbol: data.template.symbol,
            attributes: {
              Name: data.Name,
              Location: data.Location,
              area: data.area,
              population: data.population,
            },
            popupTemplate: data.template.popup,
          });
        };
        var createGraphic = function (data) {
          return new Graphic({
            geometry: data,
            symbol: data.symbol,
            attributes: data.attributes,
            popupTemplate: data.popupTemplate,
          });
        };
        var graphicsLayer = new GraphicsLayer();
        jsondata.polygons.forEach(function (data) {
          graphicsLayer.add(createGraphic(data));
        });
        jsondata.points.forEach(function (data) {
          graphicsLayer.add(createPointGraphic(data));
        });
        jsondata.lines.forEach(function (data) {
          graphicsLayer.add(createGraphic(data));
        });
        map.add(graphicsLayer);
      });
    </script>
